import Link from "next/link";

export default () => (
  <header style={{ background: "#102030" }}>
    <nav>
      <Link href="/">
        <a className="logo">
          <h1>Killerpedia</h1>
        </a>
      </Link>
      <ul>
        <li>
          <Link href="/">
            <a>Male killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Female killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Country</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Serial Killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Mass murderers</a>
          </Link>
        </li>
      </ul>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
          text-transform: capitalise;
        }

        ul {
          margin: 0;
          padding: 0;
          display: flex;
          list-style: none;
          justify-content: space-between;
        }

        li {
          margin-right: 1rem;
        }

        a {
          font-weight: 300;
          font-size: 14px;
          color: inherit;
          text-decoration: none;
          transition: all 0.2s;
          padding: 0.5rem 0.1rem;
          letter-spacing: 1px;
        }

        a:hover {
          color: white;
        }

        span {
          margin-right: 1rem;
        }

        .logo {
          flex: 1;
        }

        h1 {
          font-size: 1.5rem;
          margin: 4px 0;
          font-weight: 500;
        }
      `}</style>
    </nav>
  </header>
);
